(51, 'Variables et constantes', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les variables sont utilisées pour stocker des données qui peuvent changer pendant l\'exécution d\'un script. En PHP, les noms de variables commencent toujours par un signe dollar (<code>$</code>). Pour déclarer une variable, il suffit de lui attribuer une valeur.</p>\r\n\r\n<h2>Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">$nom = \"Jean\";\r\n$age = 25;\r\n$taille = 1.75;\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez changer la valeur d\'une variable à tout moment :</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">$age = 26;\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">PHP est un langage à typage faible, ce qui signifie que vous n\'avez pas besoin de déclarer explicitement le type de la variable.</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Les constantes en PHP :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les constantes sont similaires aux variables, mais leur valeur ne peut pas être modifiée une fois qu\'elles sont définies. Les constantes sont généralement utilisées pour des valeurs qui restent les mêmes tout au long de l\'exécution du script.</p>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Pour définir une constante, utilisez la fonction <code>define()</code> ou le mot-clé <code>const</code> :</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Utilisation de <code>define()</code> :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">define(\"PI\", 3.14159);\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Utilisation de <code>const</code> (uniquement pour les valeurs scalaires) :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const MAX_UTILISATEURS = 100;\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les constantes sont sensibles à la casse par défaut, et par convention, elles sont généralement écrites en majuscules.</p>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Pour utiliser une constante, il suffit de faire référence à son nom sans le signe dollar :</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">$surface_cercle = PI * $rayon * $rayon;\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">N\'oubliez pas que vous ne pouvez pas modifier la valeur d\'une constante une fois qu\'elle est définie, et essayer de le faire entraînera une erreur.</p>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les variables sont utiles lorsque vous devez stocker et manipuler des données qui peuvent changer, tandis que les constantes sont idéales pour les valeurs qui doivent rester les mêmes tout au long de votre script.</p>\r\n', 13),
(52, 'Strings', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Voici une leçon sur les chaînes de caractères (strings) en PHP :</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Les chaînes de caractères en PHP :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Une chaîne de caractères est une séquence de caractères. En PHP, il existe plusieurs façons de créer et de manipuler des chaînes.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Création de chaînes :</h2>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Guillemets simples :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$chaine1 = \'Bonjour le monde\';</code></pre>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les guillemets simples interprètent le contenu littéralement, sans interpréter les variables ou les caractères d\'échappement (sauf <code>\'</code> et <code>\\</code>).</p>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Guillemets doubles :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$nom = \"Pierre\";\r\n$chaine2 = \"Bonjour $nom\";</code></pre>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les guillemets doubles permettent l\'interpolation de variables et l\'interprétation des caractères d\'échappement.</p>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe Heredoc :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$texte = <<<EOD\r\nCeci est un texte\r\nsur plusieurs lignes.\r\nLes variables comme $nom sont interprétées.\r\nEOD;</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe Nowdoc :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$texte = <<<\'EOD\'\r\nCeci est un texte\r\nsur plusieurs lignes.\r\nLes variables comme $nom ne sont pas interprétées.\r\nEOD;</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Opérations sur les chaînes :</h2>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Concaténation :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$chaine3 = $chaine1 . \" \" . $chaine2;</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Longueur d\'une chaîne :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$longueur = strlen($chaine1);</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Accès à un caractère :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$premier_caractere = $chaine1[0];</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Extraction d\'une sous-chaîne :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$sous_chaine = substr($chaine1, 0, 5);</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Recherche dans une chaîne :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$position = strpos($chaine1, \"monde\");</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Remplacement dans une chaîne :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$nouvelle_chaine = str_replace(\"monde\", \"PHP\", $chaine1);</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Conversion de casse :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$majuscules = strtoupper($chaine1);\r\n$minuscules = strtolower($chaine1);</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Suppression des espaces :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$chaine_sans_espaces = trim($chaine1);</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les chaînes de caractères en PHP sont très flexibles et offrent de nombreuses fonctions pour les manipuler. Elles sont essentielles pour le traitement de texte, l\'affichage de données et l\'interaction avec les utilisateurs dans les applications PHP.</p>\r\n', 13),
(54, 'Structures conditionnelles en PHP :', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les structures conditionnelles permettent d\'exécuter différentes parties de code en fonction de certaines conditions.</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>if :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">La structure <code>if</code> exécute un bloc de code si une condition est vraie.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">if (condition) {\r\n    // code à exécuter si la condition est vraie\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$age = 18;\r\nif ($age >= 18) {\r\n    echo \"Vous êtes majeur.\";\r\n}\r\n</code></pre>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>if...else :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Cette structure permet d\'exécuter un bloc de code si la condition est vraie, et un autre bloc si elle est fausse.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">if (condition) {\r\n    // code si vrai\r\n} else {\r\n    // code si faux\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$heure = 14;\r\nif ($heure < 12) {\r\n    echo \"Bonjour\";\r\n} else {\r\n    echo \"Bonsoir\";\r\n}\r\n</code></pre>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>if...elseif...else :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Utilisée pour tester plusieurs conditions.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">if (condition1) {\r\n    // code si condition1 est vraie\r\n} elseif (condition2) {\r\n    // code si condition2 est vraie\r\n} else {\r\n    // code si aucune condition n\'est vraie\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$note = 15;\r\nif ($note < 10) {\r\n    echo \"Insuffisant\";\r\n} elseif ($note < 12) {\r\n    echo \"Passable\";\r\n} elseif ($note < 14) {\r\n    echo \"Assez bien\";\r\n} else {\r\n    echo \"Bien\";\r\n}\r\n</code></pre>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>switch :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Utile lorsqu\'on doit comparer une variable à plusieurs valeurs différentes.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">switch (variable) {\r\n    case valeur1:\r\n        // code\r\n        break;\r\n    case valeur2:\r\n        // code\r\n        break;\r\n    default:\r\n        // code par défaut\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$jour = \"Mardi\";\r\nswitch ($jour) {\r\n    case \"Lundi\":\r\n        echo \"Début de semaine\";\r\n        break;\r\n    case \"Mardi\":\r\n    case \"Mercredi\":\r\n    case \"Jeudi\":\r\n        echo \"Milieu de semaine\";\r\n        break;\r\n    case \"Vendredi\":\r\n        echo \"Fin de semaine\";\r\n        break;\r\n    default:\r\n        echo \"Week-end\";\r\n}\r\n</code></pre>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Opérateur ternaire :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Une forme concise pour les conditions simples.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">condition ? valeur_si_vrai : valeur_si_faux;\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$age = 20;\r\n$statut = ($age >= 18) ? \"majeur\" : \"mineur\";\r\n</code></pre>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Opérateur de coalescence nulle (??) :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Retourne le premier opérande s\'il existe et n\'est pas nul, sinon retourne le second opérande.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$nom = $_GET[\'nom\'] ?? \'Anonyme\';\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Ces structures conditionnelles sont essentielles en programmation PHP pour contrôler le flux d\'exécution du code en fonction de différentes conditions.</p>\r\n', 13),
(55, 'Fonctions', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Voici une leçon sur les fonctions en PHP :</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Les fonctions en PHP :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Une fonction est un bloc de code réutilisable qui effectue une tâche spécifique. Les fonctions permettent d\'organiser et de structurer le code, facilitant ainsi sa maintenance et sa réutilisation.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Définition d\'une fonction :</h2>\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Syntaxe :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">function nomDeLaFonction($parametre1, $parametre2) {\r\n    // corps de la fonction\r\n    return $resultat;\r\n}\r\n</code></pre>\r\n\r\n<h3 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple :</h3>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">function addition($a, $b) {\r\n    return $a + $b;\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Appel d\'une fonction :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$somme = addition(5, 3);\r\necho $somme; // Affiche 8\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Paramètres optionnels :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">On peut définir des valeurs par défaut pour les paramètres.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">function salutation($nom = \"utilisateur\") {\r\n    echo \"Bonjour, $nom !\";\r\n}\r\nsalutation(); // Affiche \"Bonjour, utilisateur !\"\r\nsalutation(\"Marie\"); // Affiche \"Bonjour, Marie !\"\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Paramètres nommés (PHP 8+) :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">On peut spécifier les paramètres par nom lors de l\'appel de la fonction.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">function creerProfil($nom, $age, $ville) {\r\n    // ...\r\n}\r\ncreerProfil(ville: \"Paris\", nom: \"Pierre\", age: 30);\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Retour de plusieurs valeurs :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">On peut utiliser un tableau ou la déstructuration pour retourner plusieurs valeurs.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">function getInfos() {\r\n    return [\"Pierre\", 30, \"Paris\"];\r\n}\r\n[$nom, $age, $ville] = getInfos();\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Fonctions anonymes et closures :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Des fonctions sans nom, souvent utilisées comme callbacks.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$dire = function($mot) {\r\n    echo \"Vous avez dit : $mot\";\r\n};\r\n$dire(\"Bonjour\");\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Fonctions fléchées (PHP 7.4+) :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Une syntaxe courte pour les fonctions simples.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$multiplier = fn($a, $b) => $a * $b;\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Portée des variables :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les variables définies à l\'extérieur d\'une fonction ne sont pas accessibles à l\'intérieur, sauf si déclarées globales ou passées en paramètre.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">$x = 10;\r\nfunction test() {\r\n    global $x;\r\n    echo $x;\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Typage des paramètres et du retour (PHP 7+) :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">On peut spécifier les types des paramètres et de la valeur de retour.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">function division(float $a, float $b): float {\r\n    return $a / $b;\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Fonctions récursives :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Des fonctions qui s\'appellent elles-mêmes.</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\"><code style=\"color: #d63384; font-family: Arial, sans-serif;\">function factorielle($n) {\r\n    if ($n <= 1) return 1;\r\n    return $n * factorielle($n - 1);\r\n}\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les fonctions sont un élément fondamental de la programmation en PHP. Elles permettent de créer du code modulaire, réutilisable et plus facile à maintenir. En organisant votre code en fonctions, vous améliorez sa lisibilité et sa structure globale.</p>\r\n', 13),
(56, '$_GET and $_POST', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">$_GET et $_POST sont des superglobales en PHP utilisées pour collecter des données envoyées à un script PHP via les méthodes HTTP GET et POST respectivement.</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>$_GET :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">$_GET est un tableau associatif contenant des variables passées au script courant via les paramètres d\'URL (aussi appelés paramètres de requête).</p>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Utilisation :</p>\r\n<ul style=\"font-family: Arial, sans-serif; font-size: 24px;\">\r\n    <li>Généralement utilisé pour des requêtes non sensibles et non modifiantes.</li>\r\n    <li>Les données sont visibles dans l\'URL.</li>\r\n    <li>Limité en taille (selon le navigateur et le serveur).</li>\r\n</ul>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple d\'URL :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">http://exemple.com/page.php?nom=Dupont&age=30</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Dans le script PHP :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\">\r\n<code style=\"color: #d63384; font-family: Arial, sans-serif;\">\r\n$nom = $_GET[\'nom\']; // Dupont\r\n$age = $_GET[\'age\']; // 30\r\n</code>\r\n</pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vérification de l\'existence d\'une clé :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\">\r\n<code style=\"color: #d63384; font-family: Arial, sans-serif;\">\r\nif (isset($_GET[\'nom\'])) {\r\n    $nom = $_GET[\'nom\'];\r\n}\r\n</code>\r\n</pre>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>$_POST :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">$_POST est un tableau associatif contenant des variables passées au script courant via la méthode POST du protocole HTTP.</p>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Utilisation :</p>\r\n<ul style=\"font-family: Arial, sans-serif; font-size: 24px;\">\r\n    <li>Utilisé pour envoyer des données plus volumineuses ou sensibles.</li>\r\n    <li>Les données ne sont pas visibles dans l\'URL.</li>\r\n    <li>Généralement utilisé avec des formulaires HTML.</li>\r\n</ul>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple de formulaire HTML :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\">\r\n<code style=\"color: #d63384; font-family: Arial, sans-serif;\">\r\n<form action=\"traitement.php\" method=\"post\">\r\n    <input type=\"text\" name=\"nom\">\r\n    <input type=\"submit\" value=\"Envoyer\">\r\n</form>\r\n</code>\r\n</pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Dans traitement.php :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\">\r\n<code style=\"color: #d63384; font-family: Arial, sans-serif;\">\r\n$nom = $_POST[\'nom\'];\r\n</code>\r\n</pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vérification et utilisation sécurisée :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\">\r\n<code style=\"color: #d63384; font-family: Arial, sans-serif;\">\r\nif ($_SERVER[\'REQUEST_METHOD\'] === \'POST\') {\r\n    $nom = isset($_POST[\'nom\']) ? htmlspecialchars($_POST[\'nom\']) : \'\';\r\n}\r\n</code>\r\n</pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Sécurité :</h2>\r\n<ul style=\"font-family: Arial, sans-serif; font-size: 24px;\">\r\n    <li>Toujours valider et assainir les données reçues via $_GET ou $_POST.</li>\r\n    <li>Utiliser <code>htmlspecialchars()</code> pour échapper les caractères spéciaux HTML.</li>\r\n    <li>Pour les requêtes SQL, utiliser des requêtes préparées pour éviter les injections SQL.</li>\r\n</ul>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Différences principales :</h2>\r\n<ul style=\"font-family: Arial, sans-serif; font-size: 24px;\">\r\n    <li><b>$_GET</b> : données visibles dans l\'URL, idéal pour le partage de liens, le bookmarking.</li>\r\n    <li><b>$_POST</b> : données non visibles dans l\'URL, plus approprié pour les données sensibles ou volumineuses.</li>\r\n</ul>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Choix entre GET et POST :</h2>\r\n<ul style=\"font-family: Arial, sans-serif; font-size: 24px;\">\r\n    <li>Utilisez GET pour des opérations idempotentes (qui ne modifient pas l\'état du serveur).</li>\r\n    <li>Utilisez POST pour des opérations qui modifient l\'état du serveur ou pour envoyer des données sensibles.</li>\r\n</ul>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Récupération de tous les paramètres :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px; font-size: 24px;\">\r\n<code style=\"color: #d63384; font-family: Arial, sans-serif;\">\r\nforeach ($_GET as $key => $value) {\r\n    echo \"$key: $value<br>\";\r\n}\r\nforeach ($_POST as $key => $value) {\r\n    echo \"$key: $value<br>\";\r\n}\r\n</code>\r\n</pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Combinaison avec d\'autres superglobales :</h2>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">$_REQUEST contient les données de $_GET, $_POST et $_COOKIE. Cependant, il est généralement recommandé d\'utiliser spécifiquement $_GET ou $_POST pour plus de clarté.</p>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">En résumé, $_GET et $_POST sont des outils essentiels en PHP pour récupérer les données envoyées par l\'utilisateur. Leur utilisation appropriée et sécurisée est cruciale pour le développement d\'applications web robustes et sûres.</p>\r\n', 13),
(57, 'Les variables', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">JavaScript est un langage de programmation utilisé pour créer des pages web interactives. Il est essentiel pour le développement front-end et peut également être utilisé sur le serveur avec Node.js.</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Les Variables en JavaScript :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les variables en JavaScript sont utilisées pour stocker des données. Elles peuvent être déclarées en utilisant <code>var</code>, <code>let</code>, ou <code>const</code>.</p>\r\n\r\n<h2>Exemple :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">var nom = \"Jean\";\r\nlet age = 25;\r\nconst taille = 1.75;\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez changer la valeur d\'une variable déclarée avec <code>var</code> ou <code>let</code>, mais pas d\'une constante déclarée avec <code>const</code> :</p>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">age = 26;  // Ok\r\ntaille = 1.80;  // Erreur\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">En JavaScript, les types de données sont dynamiques, ce qui signifie qu\'une variable peut contenir n\'importe quel type de données sans qu\'il soit nécessaire de le déclarer explicitement.</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Les Fonctions en JavaScript :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les fonctions en JavaScript permettent de regrouper du code afin de le réutiliser facilement. Elles peuvent être définies avec le mot-clé <code>function</code> ou en tant que fonctions fléchées.</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Déclaration de Fonction :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">function direBonjour() {\r\n  console.log(\"Bonjour!\");\r\n}\r\n</code></pre>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Fonction Fléchée :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const direBonjour = () => {\r\n  console.log(\"Bonjour!\");\r\n}\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez appeler une fonction en utilisant son nom suivi de parenthèses :</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Exemple d\'Appel de Fonction :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">direBonjour();  // Affiche \"Bonjour!\" dans la console\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les fonctions peuvent également accepter des paramètres et retourner des valeurs :</p>\r\n\r\n<h2 style=\"font-family: Arial, sans-serif; font-size: 24px;\">Fonction avec Paramètres et Valeur de Retour :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">function ajouter(a, b) {\r\n  return a + b;\r\n}\r\n\r\nconst resultat = ajouter(5, 3);  // resultat vaut 8\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">JavaScript est un langage flexible et puissant qui permet de créer des applications web interactives et dynamiques. Apprendre à utiliser les variables et les fonctions est une étape essentielle pour maîtriser ce langage.</p>\r\n', 14),
(58, 'Les objets', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les objets en JavaScript sont des collections de propriétés, qui sont des associations entre des noms (clés) et des valeurs. Les objets permettent de regrouper des données et des fonctionnalités connexes dans une structure unique.</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Création d\'un Objet en JavaScript :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez créer un objet en utilisant la notation littérale d\'objet ou le constructeur <code>Object</code>.</p>\r\n\r\n<h2>Notation Littérale d\'Objet :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const personne = {\r\n  nom: \"Jean\",\r\n  age: 25,\r\n  taille: 1.75\r\n};\r\n</code></pre>\r\n\r\n<h2>Utilisation du Constructeur <code>Object</code> :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const personne = new Object();\r\npersonne.nom = \"Jean\";\r\npersonne.age = 25;\r\npersonne.taille = 1.75;\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez accéder aux propriétés d\'un objet en utilisant la notation par point ou la notation entre crochets :</p>\r\n\r\n<h2>Accès aux Propriétés :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">console.log(personne.nom);  // Affiche \"Jean\"\r\nconsole.log(personne[\"age\"]);  // Affiche 25\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez également ajouter ou modifier des propriétés d\'un objet après sa création :</p>\r\n\r\n<h2>Ajout et Modification de Propriétés :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">personne.profession = \"Développeur\";\r\npersonne.age = 26;\r\nconsole.log(personne);  // Affiche {nom: \"Jean\", age: 26, taille: 1.75, profession: \"Développeur\"}\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les objets peuvent également contenir des méthodes, qui sont des fonctions définies en tant que propriétés de l\'objet :</p>\r\n\r\n<h2>Ajout de Méthodes :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const personne = {\r\n  nom: \"Jean\",\r\n  age: 25,\r\n  taille: 1.75,\r\n  direBonjour: function() {\r\n    console.log(\"Bonjour, je m\'appelle \" + this.nom);\r\n  }\r\n};\r\n\r\npersonne.direBonjour();  // Affiche \"Bonjour, je m\'appelle Jean\"\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les objets sont fondamentaux en JavaScript et sont utilisés pour créer des structures de données complexes et pour modéliser des concepts du monde réel dans vos applications web.</p>\r\n', 14),
(59, 'Les tableaux', '<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les tableaux en JavaScript sont des collections ordonnées d\'éléments. Ils peuvent contenir des valeurs de différents types et sont utilisés pour stocker des listes de données.</p>\r\n\r\n<h1 style=\"font-family: Arial, sans-serif; font-size: 24px;\"><b>Création d\'un Tableau en JavaScript :</b></h1>\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez créer un tableau en utilisant la notation littérale de tableau ou le constructeur <code>Array</code>.</p>\r\n\r\n<h2>Notation Littérale de Tableau :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const fruits = [\"Pomme\", \"Banane\", \"Orange\"];\r\n</code></pre>\r\n\r\n<h2>Utilisation du Constructeur <code>Array</code> :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const fruits = new Array(\"Pomme\", \"Banane\", \"Orange\");\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez accéder aux éléments d\'un tableau en utilisant leur indice, qui commence à 0 :</p>\r\n\r\n<h2>Accès aux Éléments :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">console.log(fruits[0]);  // Affiche \"Pomme\"\r\nconsole.log(fruits[1]);  // Affiche \"Banane\"\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Vous pouvez également modifier les éléments d\'un tableau en accédant à leurs indices :</p>\r\n\r\n<h2>Modification d\'Éléments :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">fruits[1] = \"Kiwi\";\r\nconsole.log(fruits);  // Affiche [\"Pomme\", \"Kiwi\", \"Orange\"]\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les tableaux en JavaScript possèdent de nombreuses méthodes intégrées pour manipuler leurs éléments :</p>\r\n\r\n<h2>Méthodes de Tableaux :</h2>\r\n<pre style=\"background-color: #f5f5f5; padding: 10px; border-radius: 5px;\"><code style=\"color: #d63384;\">const fruits = [\"Pomme\", \"Banane\", \"Orange\"];\r\n\r\n// Ajouter un élément à la fin\r\nfruits.push(\"Mangue\");\r\nconsole.log(fruits);  // Affiche [\"Pomme\", \"Banane\", \"Orange\", \"Mangue\"]\r\n\r\n// Supprimer le dernier élément\r\nfruits.pop();\r\nconsole.log(fruits);  // Affiche [\"Pomme\", \"Banane\", \"Orange\"]\r\n\r\n// Ajouter un élément au début\r\nfruits.unshift(\"Fraise\");\r\nconsole.log(fruits);  // Affiche [\"Fraise\", \"Pomme\", \"Banane\", \"Orange\"]\r\n\r\n// Supprimer le premier élément\r\nfruits.shift();\r\nconsole.log(fruits);  // Affiche [\"Pomme\", \"Banane\", \"Orange\"]\r\n</code></pre>\r\n\r\n<p style=\"font-family: Arial, sans-serif; font-size: 24px;\">Les tableaux sont très flexibles et puissants, ce qui en fait un outil essentiel pour le développement JavaScript. Ils vous permettent de gérer et de manipuler efficacement les collections de données.</p>\r\n', 14),
